    function Init() {
        if ($sessionStorage.DocumentPreview != undefined) {
            vm.documentModules = [];
            vm.client = $sessionStorage.DocumentPreview.customer;
            var documentModules = $sessionStorage.DocumentPreview.DocumentModuleValues;


            var query = 'select * from Module where Id in ( ' +
                        'select IdModule from DocumentTypeModule ' +
                        'where IdDocumentType = ' + $sessionStorage.DocumentPreview.DocTypeId +
                        ')';


            $q.all([updateData.ExecuteCustomQuery(query)])
                       .then(function (result) {
                           //vm.modules = Enumerable.From(result[0].item)
                           //.ToArray();

                           vm.modules = [];

                           for (var i = 0; i != result[0].rows.length; ++i)
                               vm.modules.push(result[0].rows.item(i));

                           for (var i = 0; i < documentModules.length; ++i) {

                               if (documentModules[i].Value != "undefined") {
                                   var module = "";
                                   try
                                   {
                                       module = jQuery.parseJSON(documentModules[i].Value);
                                       
                                   }catch(error){
                                       module = documentModules[i].Value;
                                   }

                                   var code = Enumerable.From(vm.modules)
                                             .Where(function (item) { return item.Id == new Number(documentModules[i].IdModule); })
                                             .Select(function (item) { return item.Code; })
                                             .ToArray();

                                   switch (code[0]) {
                                       case "iban_mstrdtl":
                                       case "canc_mstrdtl":
                                       case "ag_mstrdtl":
                                           vm.documentModules[code[0]] = module;
                                           break;
                                       case "clnt":
                                           break;
                                       case "dynmctms":
                                           vm.dynamicItems = module;
                                           break;
                                       case "ag_prds":
                                           vm.documentModules["ag_prds"] = module;
                                           break;
                                       case "bdy":
                                           vm.body = { 'HTML': module };
                                           break;
                                       case "ag_obj":
                                           vm.documentModules["ag_obj"] = module;
                                           break;
                                       case "ag_budget":
                                           vm.documentModules["ag_budget"] = module;

                                           break;
                                   }

                               }

                           }

                           htmlBody = vm.body.HTML;
                           showHTML();
                           //placeHTML();
                       });
        }
        else {
            vm.parentController = $scope.$parent.$parent.vm;
            vm.documentModules = vm.parentController.documentModules;
            vm.client = vm.parentController.client;
            vm.dynamicItems = vm.parentController.dynamicitems;
            vm.body = vm.parentController.body;

            htmlBody = vm.body.HTML;
            placeHTML();
        }
        
        if($scope.$parent.globals.currentUser.market != undefined){
            $q.all([updateData.ExecuteCustomQuery('SELECT value FROM configuration where name = "DigitalSignature" and IdMarket = ' + $scope.$parent.globals.currentUser.market)]).then(function(result){
                if(result[0].rows.length > 0){
                    vm.remotalSignatureIsEnable = result[0].rows.item(0).Value == "ON" ? true : false;
                }
            });
        }
    }

