    function rotateImage(imageData, callbackFunction) {

        var canvas = document.createElement('canvas');
        var image = new Image();
        image.src = "data:image/jpeg;base64," + imageData;

        image.onload = function () {

            var width = 0;
            var height = 0;
            var rotation = 0;
            var imageString = ""

            //verifies if the picture is in landscape or portrait
            if (image.width > image.height) {

                //Landscape

                //Set the image size after being resized
                var finalWidth = image.height;
                var finalHeight = image.width * 0.5566;

                //Draws the landscape image has resized
                canvas.width = finalWidth
                canvas.height = finalHeight;
                canvas.getContext('2d').drawImage(image, 0, 0, finalWidth, finalHeight);

                //Sets the canvas size to the portrait image
                canvas.width = finalHeight;
                canvas.height = finalWidth;

                //Creates the image rotation and translatation
                canvas.getContext("2d").translate(finalHeight, 0);
                canvas.getContext("2d").rotate(90 * Math.PI / 180);

                //Draws the image as portrait
                canvas.getContext('2d').drawImage(image, 0, 0, finalWidth, finalHeight);

                imageString = canvas.toDataURL('image/jpeg');


            } else {


                //Portrait

                //Set the image size
                var finalWidth = image.width;
                var finalHeight = image.height;

                //Draws the image as portrait
                canvas.width = finalWidth
                canvas.height = finalHeight;
                canvas.getContext('2d').drawImage(image, 0, 0, finalWidth, finalHeight);

                imageString = canvas.toDataURL('image/jpeg');

            }

            callbackFunction(imageString);

        }
    }

