    vm.openModal = function (type) {
        vm.validationStep = null;
        if(type == 'customer')
            vm.whoIsSignatured = 'Customer';
        else
            vm.whoIsSignatured = 'Customer Representative';
        
        vm.validationMessage = "";
        //Validation
        var keys = Object.keys(vm.parentController.validations);
        var isValid = true;

        if (vm.parentController.IBANPicMandatory == true) {
            if (vm.ibanImage == null) {
                isValid = false;
                vm.validationMessage += '<p><span>' + 'Iban Image is Mandatory.' + '</span></p>';
            }
        }

        if (vm.parentController.NIFPicMandatory == true) {
            if (vm.nif2Image == null || vm.nif1Image == null) {
                isValid = false;
                vm.validationMessage += '<p><span>' + 'NIF Image is Mandatory.' + '</span></p>';
            }
        }

        for (var i = 0; i < keys.length; ++i) {
            var validations = vm.parentController.validations[keys[i]];
            if (validations != undefined) {
                var Inputkeys = Object.keys(validations);
                for (var j = 0; j < Inputkeys.length; ++j) {
                    var validation = validations[Inputkeys[j]];
                    if (!validation.IsValid) {
                        vm.validationMessage += '<p style=\"font-weight:bold;color:red\">' + keys[i] + '</p>';
                        vm.validationMessage += '<p><span style="font-weight:bold;color:red">' + Inputkeys[j] + ': </span>';
                        vm.validationMessage += '<span>' + validation.Msg + '</span></p>';
                        isValid = false;
                        vm.validationMessage += "<br/>";

                        if(!vm.validationStep){
                            switch(keys[i]){
                                case 'Customer':
                                    vm.validationStep = vm.parentController.documenttypemodulesfull.findIndex(x => x.Code == 'clnt_edit');
                                break;
                                case 'Master Details':
                                    vm.validationStep = vm.parentController.documenttypemodulesfull.findIndex(x => x.Code == 'ag_mstrdtl' || x.Code == 'canc_mstrdtl' || x.Code == 'iban_mstrdtl' || x.Code == 'dd_mstrdtl' || x.Code == 'df_mstrdtl');
                                break;
                                case 'Periods':
                                    vm.validationStep = vm.parentController.documenttypemodulesfull.findIndex(x => x.Code == 'ag_prds') ;
                                break;
                                case 'Objectives':
                                    vm.validationStep = vm.parentController.documenttypemodulesfull.findIndex(x => x.Code == 'ag_obj');
                                break;
                            }
                            
                        }
                    }
                }
            }
        }

        //validate dynamic items
        if (vm.parentController.dynamicitems != undefined) {
            var aux = '';
            for (var i = 0; i < vm.parentController.dynamicitems.length; ++i) {
                if (vm.parentController.dynamicitems[i].IsValid != undefined && !vm.parentController.dynamicitems[i].IsValid) {
                    aux += '<p><span style="font-weight:bold;color:red">' + vm.parentController.dynamicitems[i].Label + ' input:</span><span>' + vm.parentController.dynamicitems[i].ValMessage + "</span></p>";
                    isValid = false;
                    if(!vm.validationStep){
                        vm.validationStep = vm.parentController.documenttypemodulesfull.findIndex(x => x.Code == 'dynmctms') ;
                    }
                    
                }
            }

            if (aux != '') {
                vm.validationMessage += "<p style='font-weight:bold;color:red'>Form Inputs</p>";
                vm.validationMessage += aux;
            }
        }

        vm.validationMessage += "<br/>";

        vm.signatureType = type;
        if (vm.signatureType == "cr") {
            //no faz validao
            isValid = true;
        }

        if (!isValid) {
            $('#modalValidation').modal('toggle');

        } else {
            let remoteSignatureTemplate = parentController.template.RemoteSignature;
            if(vm.remotalSignatureIsEnable && (remoteSignatureTemplate == 'true') && (type != 'bb')){
                $('#modalSignatureType').modal('toggle');
                $('#signature-pad').width('100%');
            }else{
                vm.OpenCustomerSignatureModal();
            }
        }

    }
                                               
